    category_parsed = xpath_parse(film_tree, category_xpath)
    category = '::'.join(category_parsed).encode('utf-8').decode('utf-8')

    actors_xpath = "//p[contains(., 'Featuring')]/following-sibling::p/a/text()"
    actors_parsed = xpath_parse(film_tree, actors_xpath)
    actors = '::'.join(actors_parsed).encode('utf-8').decode('utf-8')

    alternate_titles_xpath = "//span[@class='work-alternate-title']/text()"
    alternate_titles_parsed = xpath_parse(film_tree, alternate_titles_xpath)
    alternate_titles = '::'.join(alternate_titles_parsed).encode('utf-8').decode('utf-8')

    # Add data to 
    films.append([film_id, title, director, year, country, genre, film_type, category, actors, alternate_titles])

    # Write to CSV
    array2csv(films, 'films_2012')

    print([film_id, title, director, year, country, genre, film_type, category, actors, alternate_titles])